import React from "react";
import PostTd from "./Test_PostTd";

interface PostItem {
  order: number;
  id: string;
  name: string;
  date: string;
  title: string;
  content: string;
}

interface PostTrProps {
  info: PostItem[];
  user_id: any;
}

const PostTr: React.FC<PostTrProps> = ({ info, user_id }) => {
  return (
    <tbody>
      {info.map((item) => (
        <PostTd item={item} user_id={user_id} />
      ))}
    </tbody>
  );
};

export default PostTr;
